// Dependencies.
import React from 'react';

// Component 'TopScroll'.
function TopScroll() {
    return (
        // TopScroll Container.
        <>
            <a href="#LandingPage">
                <button id="TopScroll" className="animated fadeInRight bounce slow btn btn-default">
                    Back to Top
                </button>
            </a>
        </>
    );
}

// Do export.
export default TopScroll;
